import React, { useState } from "react";
import "./ListarUsuarios.css";
import axios from "axios";
import Box from '@mui/material/Box';
import { DataGrid } from '@mui/x-data-grid';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import TextField from '@mui/material/TextField';

export default class ListarUsuario extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      rows: [],
      loading: true,
      search: '',
      filter: 'Todos'
    };
  }

  async componentDidMount() {
    try {
      const [advogadosResponse, clientesResponse, associadosResponse] = await Promise.all([
        axios.get('http://localhost:8080/api/advogado'),
        axios.get('http://localhost:8080/api/cliente'),
        axios.get('http://localhost:8080/api/associado')
      ]);

      const advogados = advogadosResponse.data.map(item => ({
        ...item,
        tipo: 'Advogado',
        id: `adv-${item.id}`,
        email: item.login
      }));

      const clientes = clientesResponse.data.map(item => ({
        ...item,
        tipo: 'Cliente',
        id: `cli-${item.id}`,
        email: item.email
      }));

      const associados = associadosResponse.data.map(item => ({
        ...item,
        tipo: 'Associado',
        id: `ass-${item.id}`,
        email: item.login
      }));

      const combinedRows = [...advogados, ...clientes, ...associados];

      this.setState({ rows: combinedRows, loading: false });
    } catch (error) {
      console.error('Erro ao buscar os dados:', error);
      this.setState({ loading: false });
    }
  }

  handleSearchChange = (event) => {
    this.setState({ search: event.target.value });
  };

  handleFilterChange = (filter) => {
    this.setState({ filter });
  };

  getFilteredRows = () => {
    const { rows, search, filter } = this.state;
    return rows.filter(row => {
      const matchesFilter = filter === 'Todos' || row.tipo === filter;
      const matchesSearch = row.nome.toLowerCase().includes(search.toLowerCase()) || row.email.toLowerCase().includes(search.toLowerCase());
      return matchesFilter && matchesSearch;
    });
  };

  render() {
    const { loading, search, filter } = this.state;

    const columns = [
      { field: 'id', headerName: 'ID', width: 180},
      {
        field: 'nome',
        headerName: 'Nome',
        width: 200,
      },
      {
        field: 'email',
        headerName: 'Email',
        width: 200,
      },
      {
        field: 'tipo',
        headerName: 'Tipo',
        width: 180,
      },
    ];

    return (
      <div className="container">
        <div className="row">
          <div className="col-lg-12">
            <div className="bs-component">
             <div style={{marginTop: '100px'}}>
             <div style={{ marginTop: '20px', padding: '20px', border: '2px solid #838383', borderRadius: '5px' }}>
              <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginTop: '20px' }}>
                <TextField
                  label="Buscar"
                  variant="outlined"
                  value={search}
                  onChange={this.handleSearchChange}
                  size="small"
                  style={{height:'50px', width:'280px'}}
                />
                <ButtonGroup variant="contained" aria-label="outlined primary button group">
                  <Button onClick={() => this.handleFilterChange('Todos')}>Todos</Button>
                  <Button onClick={() => this.handleFilterChange('Associado')}>Associado</Button>
                  <Button onClick={() => this.handleFilterChange('Advogado')}>Advogado</Button>
                  <Button onClick={() => this.handleFilterChange('Cliente')}>Cliente</Button>
                </ButtonGroup>
              </Box>
                {loading ? (
                  <p>Carregando...</p>
                ) : (
                  <Box sx={{ height: 400, width: '100%' }}>
                    <DataGrid
                      rows={this.getFilteredRows()}
                      columns={columns}
                      pageSize={5}
                      rowsPerPageOptions={[5, 10, 20]}
                      disableSelectionOnClick
                    />
                  </Box>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
      </div>
    );
  }
}
